import React from 'react';
import Styles from './Card.module.css';
//hooks
import useCard from './useCard';
const Card = ()=>{
    const [imgArr] = useCard();
    console.log(imgArr);
    return (
        <div>
            <img className = {Styles.container} src = {imgArr.largeImageURL} width = {imgArr.imageWidth/10} height = {imgArr.imageHeight/10}>

            </img>
        </div>
    )
}
export default Card;
